import React, { useState } from 'react';
import './Doctor.css';

function DoctorComponent() {
  const [inputValue, setInputValue] = useState('');
  const [title, setTitle] = useState('');
  const [description, setDescription] = useState('');

  const handleInputChange = (event) => {
    setInputValue(event.target.value);
  };

  const handleTitleChange = (event) => {
    setTitle(event.target.value);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handleSubmit = (event) => {
    event.preventDefault();
    // handle form submission logic here
    // e.g. send data to server
  };

  return (
    <div className="doctor-body-container">

      <div className="request-approval-container">
        {/* FOR THE LEFT SIDE */}
        <div className="approval-container">
        <h1>Left Side</h1>
        </div>
      </div>

      {/* FOR THE RIGHT SIDE */}
      <div className="profile-container">
        <form onSubmit={handleSubmit}>
          <div className='request-form'>
            <label htmlFor="inputField">Input Field:</label>
            <input
              type="text"
              id="inputField"
              name="inputField"
              value={inputValue}
              onChange={handleInputChange}
            />
            <br />
            <br />
            <label htmlFor="fileField">File Upload:</label>
            <input
              type="file"
              id="fileField"
              name="fileField"
            />
            <br />
            <br />
            <label htmlFor="titleField">Title:</label>
            <input
              type="text"
              id="titleField"
              name="titleField"
              value={title}
              onChange={handleTitleChange}
            />
            <br />
            <br />
            <label htmlFor="descriptionField">Description:</label>
            <textarea
              id="descriptionField"
              name="descriptionField"
              value={description}
              onChange={handleDescriptionChange}
            ></textarea>
            <br />
            <br />
            <button type="submit">Submit</button>
            <button type="reset">Reset</button>
          </div>
        </form>
      </div>


    </div>
  );
}

export default DoctorComponent;
